import React, { Component } from 'react';
import '../style.css';

import Colors from '../colors';

const Socials = (props) => {
	return (
		<div className="my-container center" style={styles.tag}>
			<p style={styles.tagText}>{props.name}</p>
		</div>
	);
};

const styles = {
	tag: {
		backgroundColor: Colors.accent,
		borderRadius: '20px'
	},
	tagText: {
		padding: '15px',
		marginBottom: '0px'
	}
};

export default Socials;
